import React from 'react'
import { NavLink } from 'react-router-dom'

import './css/List.scss'

const List = ({data}) => {
    return (
        <div className="list_box">
            <NavLink to={data.path} className="nav_list"> ALL
                <div className="arrow">Arrow</div>
            </NavLink>
        </div>
    )
}

export default List;
